import Link from 'next/link';
import styled from 'styled-components';
import Navbar from '../components/Navbar';

const Index = styled.div`
  background-color: black;
  margin: 0;
  padding: 0;
  box-sizing: border-box;
`

export default () => {
  return (
    <div className='main'>
      <h1>Start Learning</h1>
      <Navbar />
    </div>
  );
}
